// App.js

import React from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <Link to="/signin">Sign In</Link>
        <Link to="/signup">Sign Up</Link>
      </header>
    </div>
  );
}

export default App;
